import React from 'react';
import logo from './logo.svg';
import './App.css';
// import { count as c, length as l } from './number.js';
import * as nums from './numbers';

console.log(nums.window.count + nums.window.length);




function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p style = {{color: 'red'}} >
          Edit <code>src/App.js</code> and save to reload.
        </p>
    // <p> { count, length } </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"w
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
  );
}

export default App;
